const base64ImageResize = require("../utils/base64ImageResize");
/**
 * tutorial url
 *
 * https://github.com/lovell/sharp
 */

const base64Image = "data:image/jpeg;base64,";

module.exports = function (req, res, next) {
  base64ImageResize(base64Image, 128, 128)
      .then(resizedImage => {
        // return res.send(resizedImage);
        let parts = resizedImage.split(';');
        let mimType = parts[0].split(':')[1];
        let imageData = parts[1].split(',')[1];
        let img = new Buffer(imageData, 'base64');
        res.writeHead(200, {
          'Content-Type': mimType,
          'Content-Length': img.length
        });
        res.end(img);
      })
      .catch(error => {
        res.send(error)
      })
}